Planning me a trip to Bali & Disney World in Paris. 
@upnext_bnc
 pack ya bags phat

Do not book #holidays with 
@MercuryHolidays
 (sunspot tours ltd)via 
@HaysTravel
 or 
@cathaypacific
 Cancelled our holiday we worked so hard to pay for no reason other than their greed. Ruined our long awaited Bali dream & won’t fix it. 
Do Not fall victim! 
#HolidayShopping #Travel

Had a great trip to Bali, only for the experience to be soured by 
@VietjetIndia
 @vietjetair
 @VietjetairCom
 while returning. All our carry-on bags were weighed in at Bali, and we had a go-ahead. Had a pleasant trip to Ho Chi Minh and this is where everything went south.

